import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../style/UpdateNewUser.css'

const UpdateNewUser = ({ userId, role, onChangePage}) => {
    const [user, setUser] = useState({
        username: '',
        person: '',
        password: '',
        adminStatus: ''
    });
    const [employee, setEmployee] = useState({
        firstName: '',
        lastName: '',
        dateOfBirth: '',
        address: '',
        phoneNumber: '',
        email: ''
    });

    useEffect(() => {
        if (userId) {
            // Fetch user data for editing if plantId is provided
            axios.get(`http://localhost:8080/users/findById?id=${userId}`)
                .then(response => {
                    setUser(response.data);
                })
                .catch(error => {
                    console.error('Error fetching user data:', error);
                });

            axios.get(`http://localhost:8080/employee/findByUser?id=${userId}`)
                .then(response => {
                    setEmployee(response.data);
                })
                .catch(error => {
                    console.error('Error fetching personal data:', error);
                });

        }
    }, [userId]);

    const onButtonClickCancel = () => {
        onChangePage(role, 3, 0, 0);
    }

    const handleChangeUser = (e) => {
        const { name, value } = e.target;
        setUser(prevUser => ({
            ...prevUser,
            [name]: value
        }));
    };

    const handleChangeEmployee = (e) => {
        const { name, value } = e.target;
        setEmployee(prevEmp => ({
            ...prevEmp,
            [name]: value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (userId) {
            // Update existing data
            axios.put(`http://localhost:8080/users/update`, user)
                .then(response => {
                    console.log('User updated successfully:', response.data);
                    // Optionally redirect to another page or display a success message
                })
                .catch(error => {
                    console.error('Error updating user data:', error);
                });

            
        } else {
            // Add new data
            axios.post('http://localhost:8080/users/add', user)
                .then(response => {
                    console.log('New user added successfully:', response.data);
                    // Optionally redirect to another page or display a success message
                })
                .catch(error => {
                    console.error('Error adding new user:', error);
                });

            axios.post('http://localhost:8080/employee/add', employee)
                .then(response => {
                    console.log('New personal data added successfully:', response.data);
                    // Optionally redirect to another page or display a success message
                })
                .catch(error => {
                    console.error('Error adding new data:', error);
                });
        }
    };


    return (
        <div>
            <h2>{userId ? 'Edit User' : 'Add New User'}</h2>
            <form onSubmit={handleSubmit} >
                <label>First name:</label>
                <input type="text" name="firstName" value={employee.firstName} onChange={handleChangeEmployee} disabled={!!userId} />
                <label>Last name:</label>
                <input type="text" name="lastName" value={employee.lastName} onChange={handleChangeEmployee} disabled={!!userId} />
                <label>Date of birth:</label>
                <input type="text" name="dateOfBirth" value={employee.dateOfBirth} onChange={handleChangeEmployee} disabled={!!userId} />
                <label>Address:</label>
                <input type="text" name="address" value={employee.address} onChange={handleChangeEmployee} disabled={!!userId} />
                <label>Phone number:</label>
                <input type="text" name="phoneNumber" value={employee.phoneNumber} onChange={handleChangeEmployee} disabled={!!userId} />
                <label>Email:</label>
                <input type="text" name="email" value={employee.email} onChange={handleChangeEmployee} disabled={!!userId} />
                <label>Username:</label>
                <input type="text" name="username" value={user.username} onChange={handleChangeUser} />
                <label>Password:</label>
                <input type="text" name="password" value={user.password} onChange={handleChangeUser} />
                <label>Admin status:</label>
                <input type="text" name="adminStatus" value={user.adminStatus} onChange={handleChangeUser} />
                <div>
                    <button onClick={onButtonClickCancel}>Cancel</button>
                    <button type="submit">{userId ? 'Update User' : 'Add User'}</button>
                </div>
            </form>
        </div>
    );
};

export default UpdateNewUser;
